            <div className="card-header d-flex justify-content-between">
                <span>Joan</span>
                <span><StarRating rating={3}/></span>
            </div>
            <div className="card-body">
                <p className="card-text">This restaurant was awesome.</p>
            </div>
        </div>
    </div>
  );
};

export default Reviews;
